//SPDX-License-Identifier: GPL-3.0

pragma solidity >=0.6.0;
pragma experimental ABIEncoderV2;


/** 
 * @title Database
 * @dev Save Professor
 */

contract Database {
    // 출석 내용을 저장하는 enum 타입 (0=success, 1=fail)
    //enum Reservation_state { Success, Fail }

    struct Student_DB{
        string student_name;
        address student;

    }

    struct Bus_DB{
        address bus;
        string destination;
        uint start_time;
        uint[45] Seat_number;
    }

    struct bus_seat{
        string student_name;
        uint student_id;
    }

    //array Seat[] = Seat_number;
   //관리자
    address private manager;
//버스 명단
    address[] private buses;
   //학생들 명단
    address[] private students;
   //버스 번호
    string[] private busNum;
   //학생 학번
    uint[] private studentNum;

    //constructor() public {
    //    manager = msg.sender;
    //}

    mapping(string => Bus_DB) BusDB; 
    mapping(uint => Student_DB) StudentDB;
    mapping(uint => bus_seat) BusSeat;

    function reservation_seat(uint seat_num, string memory student_name, uint student_id) public {
        BusSeat[seat_num] = bus_seat(student_name, student_id);
    }

    function addStudent(string memory student_name, uint studentNum, address students) public {
       StudentDB[studentNum] = Student_DB(student_name, students);
    }

    function addBus(address bus, string memory destination, uint start_time, string memory busNum) public {
      uint[45] memory seat;
      //seat.push(0,0);
      //seat[0]=Seat(0,0);
      //uint i = seat.length++;
      //seat[i].SeatNum = 0;
      //seat[i].StudentId = 0;
      //for(uint i=0; i<45; i++){
      //  seat[i]=Seat(0, true);
      //}
      BusDB[busNum] = Bus_DB(bus, destination, start_time, seat);
    }


}

